import react,{useState} from 'react'
import Navbar from './components/Navbar'
import Body from './components/Body'
import Welcome from './components/Welcome'
const App=()=>{
const [windowCng,setWindow]=useState(false)
if(windowCng==true)
{
return(
<>
<Navbar/>
<Body/>
</>
)
}else{
    return(
        <>
        <Navbar/>
        <Welcome/>
        </>
        )   
}
}
export default App;
